Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"ariaDraggableIndex\":\"@index of @count draggables.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"textField\":\"A. Look at this *hole* in your sports shoes. I think you need new ones.\\nB. Everybody was watching as the ball went straight into *the hoop*.\\nC. The coach got new blue *basketball jerseys*. They look very nice. \\nD. I think we make a good *team*. We all play together, and every member tries their best to win the game.\\nE. This puzzle is very*challenging*. It is large with very small pieces.\\nF. The little kids kept *bouncing* on the bed until it broke.\",\"submitAnswer\":\"Submit\",\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.DragText 1.10\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Sentence Completion\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sentence Completion\"},\"subContentId\":\"7020f7eb-811e-45c0-aa30-b3227823c4d3\"},{\"params\":{\"media\":{\"disableImageZooming\":false},\"text\":\"<p>12. Complete the sentences with the right comparative form of the adjectives in parentheses. Add \\\"than\\\" whenever needed.</p>\\n\",\"overallFeedbac ar than* baseball.</p>\\n\\n<p>G. Your water bottle is (cold) *colder than* mine.</p>\\n\\n<p>H. Look at your sports uniform! It looks so dirty. It's (dirty) *dirtier than* mine.</p>\\n\\n<p>I.&nbsp;Joe wasn't very good at rollerblading. However, he practiced very hard, and now he's much (good) *better than* before.</p>\\n\"],\"submitAnswer\":\"Submit\"},\"library\":\"H5P.Blanks 1.14\",\"metadata\":{\"contentType\":\"Fill in the Blanks\",\"license\":\"U\",\"title\":\"Comparative Adjectives\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Comparative Adjectives\"},\"subContentId\":\"2be47a80-4e02-4024-b03c-73cd364e62b1\"}]}","library":"H5P.QuestionSet 1.20","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Test Your Understanding","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.Question-1.5/scripts/question.js?version=1.5.13","/h5p/libraries/H5P.Question-1.5/scripts/explainer.js?version=1.5.13","/h5p/libraries/H5P.Question-1.5/scripts/score-points.js?version=1.5.13"
